  `descripcion` varchar(2000) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Descripción completa del item (del XML)',
  `codigo_producto` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Código del producto del proveedor',
  `codigo_estandar` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Código estándar: EAN, UNSPSC, etc.',
  `cantidad` decimal(15,4) NOT NULL COMMENT 'Cantidad facturada',
  `unidad_medida` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT 'unidad' COMMENT 'Unidad de medida: unidad, kg, litro, hora, etc.',
  `precio_unitario` decimal(15,4) NOT NULL COMMENT 'Precio unitario del item',
  `total_impuestos` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT 'Total de impuestos aplicados al item (IVA, etc.)',
  `descuento_porcentaje` decimal(5,2) DEFAULT NULL COMMENT 'Porcentaje de descuento aplicado',
  `descuento_valor` decimal(15,2) DEFAULT NULL COMMENT 'Valor del descuento aplicado',
  `descripcion_normalizada` varchar(500) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Descripción normalizada para matching (lowercase, sin acentos, etc.)',
  `item_hash` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Hash MD5 de descripcion_normalizada para comparación rápida',
  `categoria` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Categoría del item: software, hardware, servicio, consumible, etc.',
  `es_recurrente` decimal(1,0) DEFAULT '0' COMMENT '1 si el item aparece mensualmente, 0 si es esporádico',
  `notas` varchar(1000) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Notas adicionales sobre el item',
  `creado_en` datetime NOT NULL DEFAULT (now()) COMMENT 'Timestamp de creación',
  `subtotal` decimal(15,2) NOT NULL COMMENT 'Subtotal del item (cantidad × precio_unitario - descuentos)',
  `total` decimal(15,2) NOT NULL COMMENT 'Total del item (subtotal + impuestos)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_factura_item_linea` (`factura_id`,`numero_linea`),
  KEY `ix_factura_items_codigo_producto` (`codigo_producto`),
  KEY `idx_item_recurrente_categoria` (`es_recurrente`,`categoria`),
  KEY `idx_item_hash_factura` (`item_hash`,`factura_id`),
  KEY `idx_item_descripcion_norm` (`descripcion_normalizada`),
  KEY `ix_factura_items_categoria` (`categoria`),
  KEY `ix_factura_items_factura_id` (`factura_id`),
  KEY `ix_factura_items_item_hash` (`item_hash`),
  KEY `idx_item_codigo_producto` (`codigo_producto`,`factura_id`),
  KEY `ix_factura_items_descripcion_normalizada` (`descripcion_normalizada`),
  CONSTRAINT `factura_items_ibfk_1` FOREIGN KEY (`factura_id`) REFERENCES `facturas` (`id`) ON DELETE CASCADE,
  CONSTRAINT `chk_items_cantidad_positiva` CHECK ((`cantidad` > 0)),
  CONSTRAINT `chk_items_descuento_valido` CHECK (((`descuento_porcentaje` is null) or ((`descuento_porcentaje` >= 0) and (`descuento_porcentaje` <= 100)))),
  CONSTRAINT `chk_items_precio_positivo` CHECK ((`precio_unitario` >= 0)),
  CONSTRAINT `chk_items_subtotal_positivo` CHECK ((`subtotal` >= 0)),
  CONSTRAINT `chk_items_total_positivo` CHECK ((`total` >= 0))
) ENGINE=InnoDB AUTO_INCREMENT=556 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
